column2:
What is printed by the console.log statements?

var f = function () {
    console.log(2);
};
setTimeout(f, 10);
console.log(1);

What is printed by the console.log statements?

var a = 0;
var b = 1;
var f = function () {
    a = 2;
    b = 3;
    console.log(b);
};
setTimeout(f, 10);
console.log(a);

What is printed by the console.log statement?

var f = function () {
    var i = 1;
    console.log(i++);
    setTimeout(f, 100);
};
f();

What is printed by console.log?

var f = function () {
    var i = 1;
    console.log(i++);
};
setInterval(f, 10);

Assuming we are in a web browser, what is printed by console.log?

window.addEventListener("load", function () {
    document.body.addEventListener("click", function () {
        console.log(2);
    });
    console.log(3);
});
console.log(1);

What is printed by console.log?

var f = function () {
    console.log(42);
};
var id = setInterval(f, 10);
clearInterval(id);

What is printed by console.log?

var i = 0;
setTimeout(function () {
    i += 1;
    console.log(i);
}, 100)
setTimeout(function () {
    console.log("hi");
}, 200);
console.log("hello")

What is the value printed by console.log?

var f = function (a, b) {
    console.log(arguments.length);
};
f(1, 2, 3);

What is the value printed by console.log?

var f = function (a, b) {
    return a + b;
};
console.log(f.length);

What is the value printed by console.log?

var Animal = function (a) {
    this.name = a;
};
var cat = new Animal("Tom");
console.log(cat.name);

What is the value printed by console.log?

var Animal = function (a) {
    var name = a;
    this.getName = function () {
        return name;
    };
};
var cat = new Animal("Tom");
console.log(cat.name);

What is the value printed by console.log?

var Animal = function (a) {
    var name = a;
    this.getName = function () {
        return name;
    };
};
var cat = new Animal("Tom");
console.log(cat.getName());

What is the value printed by console.log?

var Animal = function (a) {
    var name = a;
};
Animal.prototype.getName = function () {
    return name;
};
var cat = new Animal("Tom");
console.log(cat.getName());

Which statement is most correct when describing the differences between:

// Function Declaration
function f () {
    return 42;
}

and:

// Function Expression
var f = function () {
    return 42;
};

What is the value printed by console.log?

var f = function () {
    return function () {
        return 42;
    };
};
console.log(f()());

What is the value printed by console.log?

var f = function (a, b, c) {
    console.log(a, b, c)
};
f(1, 2);

What is the value printed by console.log?

var f = function (a, b, c) {
    console.log(a, b, c)
};
f(1, 2, 3, 4);

What is the value printed by console.log?

var f = function (g) {
    return g(5, 4);
};
var g = function(n) {
    console.log(n);
};
f(g);

What is the value printed by console.log?

var f = function (g) {
    return function () {
        return g(42);
    };
};
var g = function (n) {
    return n + 42;
};
var h = f(g);
console.log(h());

What is the value printed by console.log?

var f = function (g) {
    g(42);
};
var g = function (n) {
    return n + 42;
};
var h = f(g);
console.log(h());

Disregarding whether or not this is a good practice, what is the value printed by console.log?

Object.prototype._color = 'green';
var Cat = function (color) {
    color = color || this._color;
    this.color = function () {
        return color;
    };
};
var tom = new Cat();
console.log(tom.color());

What will be printed by console.log?

var Animal = function (name) {
    this.name = name || "blah";
};
Animal.prototype.speak = function () {
    return "My name is: " + this.name;
};

var Cat = function (name) {
    this.name = name || "Tom";
};
Cat.prototype = new Animal();

var c = new Cat();
console.log(c.speak());

What will be printed by console.log?

var Animal = function (name) {
    this.name = name || "blah";
};
Animal.prototype.speak = function () {
    return "My name is: " + this.name;
};

var Cat = function (name) {
    this.name = name || "Tom";
};
Cat.prototype = new Animal();
Cat.prototype.speak = function () {
    return this.name + " says meow!";
};

var c = new Cat();
console.log(c.speak());

What will be printed by console.log?

var Animal = function (name) {
    this.name = name || "blah";
};
Animal.prototype.speak = function () {
    return "My name is: " + this.name;
};

var Cat = function () {};
Cat.prototype = new Animal();
Cat.prototype.speak = function () {
    return this.name + " says meow!";
};

var c = new Cat("Tom");
console.log(c.speak());

