What is printed to console.log?

var s = "hello how are you?";
s.replace("hello", "mellow");
console.log(s);

What is printed to console.log?

var a = [1, 2, 3, 4];
a = a.map(function (i) {
    return i % 2;
});
console.log(a);

What is printed to console.log?

var a = [1, 2, 3, 4];
a = a.filter(function (i) {
    return i % 2;
});
console.log(a);

What is printed to console.log?

var a = [1, 2, 3, 4];
a = a.reduce(function (a, b) {
    return a + b;
}, 1);
console.log(a);
